class AlphaRender:
    def __init__(self, word,x , y, size):
        self.pic = cyberpi.sprite()
        self.pic.draw_pixel(word)
        self.pic.set_size(size)
        self.x = x
        self.y = y
        self.pic.set_color(200,255,5)
        self.pic.set_align("center")
        self.pic.move_to(self.x, self.y)
    
    def move(self, x, y):
        self.x = x
        self.y = y

    def render(self):
        cyberpi.screen.render()
    
    def __del__(self):
        print("finish")


def textshow(text):
    if len(text) > 10:
        x=(128-len(text)*10)/2 + 5
        scale = 80
    else:
        x = (128-len(text)*14)/2 + 8
        scale = 100
    for i in text:
        num = alphabet.find(i)
        i = AlphaRender(pic_list[num],x, y,scale)
        i.render()
        if scale <100:
            x += 10
        else:
            x += 14
        del i 
    
